import React from "react";
import { FaUserCircle, FaHome } from "react-icons/fa";

const Sidebar = () => {
  const menuItems = ["Assets", "Orders", "Account", "Settings"];

  return (
    <div className="w-1/4 bg-gray-800 p-4 text-white rounded-lg">
      <div className="flex items-center gap-3 mb-5">
        <FaUserCircle size={40} className="text-yellow-400" />
        <div className="flex items-center gap-2">
          <FaHome size={20} className="text-white" /> 
          <p className="font-semibold">Dashboard</p>
        </div>
      </div>
      <ul className="space-y-3">
        {menuItems.map((item, index) => (
          <li key={index} className="cursor-pointer">{item}</li>
        ))}
      </ul>
    </div>
  );
};

export default Sidebar;
